import React, {Component, Fragment} from 'react';
import './App.css';
import Navbar from './components/layout/Navbar'
import UserItem from './components/users/'

class App extends Component {
  foo = ()=>{return 'Bars'};

  render(){
    const name = "Mahitha";
    const loading = false;
    const showName = true;

    return (

      <div>
        <Navbar title = "Github-Finder" icon = "fa fa-github fa-2x"/>
        {loading && <h4>Loading...</h4>}
        <h1>Hello world, {showName ? name : null}</h1>
        <h2>{this.foo()}</h2>
      </div>
    );
  }
}

export default App;
